import React, { useState, useEffect } from 'react';

const WazuhAgents = () => {
  const [agentsCount, setAgentsCount] = useState({
    data: {
      total: 0,
      active: 0,
      inactive: 0,
      neverConnected: 0,
    },
  });

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await fetch("http://localhost:3001/agents_count");
      const agentsCountData = await response.json();
      setAgentsCount(agentsCountData);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <center>
        <h1>Wazuh Agents Count</h1>
        <ul>
          <li key={1}>{agentsCount.data.total}</li>
          <li key={2}>{agentsCount.data.active}</li>
          <li key={3}>{agentsCount.data.inactive}</li>
          <li key={4}>{agentsCount.data.neverConnected}</li>
        </ul>
      </center>
    </div>
  );
};

export default WazuhAgents;
